// src/App.js

import React from 'react';
import './App.css';
import profile from './profile.jpg'; // Make sure this path is correct

function App() {
  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="logo">Your Name</div>
        <ul className="nav-links">
          <li>Biography</li>
          <li>Experiences</li>
          <li>Projects</li>
        </ul>
      </nav>

      {/* 3D Shapes */}
      <div className="floating-shapes">
        <div className="shape shape-sphere"></div>
        <div className="shape shape-cylinder"></div>
        <div className="shape shape-prism"></div>
        <div className="shape shape-cube"></div>
      </div>

      {/* Profile Section */}
      <header className="App-header">
        <div className="hero-container">
          <img src={profile} alt="Avi" className="profile-picture" />
          <div className="intro-text">
            <span className="greeting-text">Hi, I'm</span> <span className="name-text">Avi!</span>
          </div>
          <p className="flipping-text">trying to build cool stuff</p>
        </div>
      </header>

      {/* Footer */}
      <footer>
        <p>&copy; 2024 Your Name. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
